import React from 'react'
import './ListItem.scss'

import yash from '../../assets/yash.png'

const ListItem = () => {
  return (
    <div className='list-item'>
      <img src={yash} alt='' />
      <div className='info'></div>
    </div>
  )
}

export default ListItem
